import React from "react";

const Pagination = props => {
  console.log(props);
  return (
    <nav aria-label="Page navigation example">
      <ul class="pagination">
        <li class="page-item">
          <a class="page-link">1</a>
        </li>
      </ul>
    </nav>
  );
};

export default Pagination;
